INSERT INTO `articles` VALUES(41, 47, 'О блоге', 'Данный блог разработан с целью обучения ремеслу back-end разработчика. При разработке использовался чистый php 7.1, без фреймворков. Архитектура построена с применением паттерна MVC и роутингом. Подтверждение Email адреса работает только с настроенным сервером (в моём случае OpenServer). Для загрузки пакетов и библиотек использовался менеджер пакетов Composer. На стороне клиента, для подгрузки комментариев в реальном времени использовался Ajax, для обработки запросов был разработан небольшой API. Для форматирования текста используется Markdown-разметка. Для работы с DB использовался паттерн, ORM, ActiveRecord, так же Reflection API.\r\n\r\n####Чтобы развернуть проект:\r\n* Установить пакеты (выполнить composer install в консоли сервера).\r\n* Импортировать базу данных в папке DB на свой сервер.\r\n* Указать параметры подключения к DB в .env.\r\n* Настроить сервер на отправку Email.\r\n\r\n####Contacts:\r\n* Developer: Anatoly Chyvel.\r\n* GitHub: http://github.com/AnatolyChyvel\r\n* Email: anatoly.chyvel@gmail.com', '2021-07-20 18:04:57');

